import Message from "../message/Message";
import logo from "../../assets/logo.png";

const FeedContainer = () => {
  return (
    <section className="feed">
      <Message
        content="Lorem Ipsum is Lorem Ipsum but was}:</Message> < img src=http://placehold.it/"
        avatar={logo}
      />
    </section>
  );
};

export default FeedContainer;
